$(()=>{$.ajax({url:"http://127.0.0.1:3000/api/getsitenav",dataType:"json",success:a=>{let n=a.result,t="";n.forEach(a=>{t+=`\n                <a href="${a.navHref}"\n                target="_blank">\n                <img src="${a.navImg}" alt="">\n                ${a.navTitle}\n            </a>\n                `}),$(".link").html(t)}})});